import React from 'react';

function BookingList({ bookings }) {
  return (
    <div className="mt-4">
      <h2 className="font-bold mb-2">Bookings</h2>
      {bookings.map(b => (
        <div key={b._id} className="p-2 bg-gray-100 mb-2 rounded">
          {b.customer_name} - {b.service_id?.name} @ {new Date(b.date_time).toLocaleString()}
        </div>
      ))}
    </div>
  );
}

export default BookingList;
